+
+export const getStaticPaths: GetStaticPaths = async () => {
+    const response = await getDocs(collection(firestore, "freelancers"))
+    const paths = []
+    response.forEach((doc) => {
+        paths.push(doc._document.data.value.mapValue.fields.displayName)
+    })
